INSERT INTO public.answers (id, question_id, answer_no, answer, correct) VALUES (1093, 365, 1, 'a) si rileva l''altra nave in rotta opposta a poppavia del traverso.', false);
INSERT INTO public.answers (id, question_id, answer_no, answer, correct) VALUES (1094, 365, 2, 'b) diminuisce la distanza tra le due navi con rotte opposte e quindi il rilevamento polare scade.', false);
