INSERT INTO public.answers (id, question_id, answer_no, answer, correct) VALUES (1099, 367, 1, 'a) l''unità A perché ha le mura a dritta e si trova a dritta dell''unità B.', false);
INSERT INTO public.answers (id, question_id, answer_no, answer, correct) VALUES (1100, 367, 2, 'b) l''unità B.', true);
