INSERT INTO public.answers (id, question_id, answer_no, answer, correct) VALUES (1129, 377, 1, 'a) nave a motore di lunghezza uguale o superiore a 50 metri con rimorchio di lunghezza superiore a 200 metri, impossibilitata a deviare dalla propria rotta, che sta dirigendo verso l''osservatore.', false);
