INSERT INTO public.answers (id, question_id, answer_no, answer, correct) VALUES (1155, 385, 3, 'c) nave di lunghezza inferiore a 50 metri con un rimorchio di lunghezza superiore a 200 metri, impossibilitata a deviare dalla propria rotta, e nave rimorchiata, che dirigono a dritta dell''osservatore.', false);
