INSERT INTO public.answers (id, question_id, answer_no, answer, correct) VALUES (1162, 388, 1, 'a) da pesca, di lunghezza uguale o superiore a 50 metri, che è intenta alla pesca a strascico, che dirige a sinistra dell''osservatore.', true);
