INSERT INTO public.answers (id, question_id, answer_no, answer, correct) VALUES (1165, 389, 1, 'a) a motore, in navigazione o con abbrivio, deve emettere, ad intervalli non superiori a 2 minuti, 1 suono prolungato e 2 brevi con un intervallo tra di loro di circa 2 secondi.', false);
INSERT INTO public.answers (id, question_id, answer_no, answer, correct) VALUES (1166, 389, 2, 'b) a motore, ferma e senza abbrivio, emette, ad intervalli non superiori a 2 minuti, 2 suoni prolungati con un intervallo tra di loro di circa 2 secondi.', true);
