INSERT INTO public.answers (id, question_id, answer_no, answer, correct) VALUES (1179, 393, 3, 'c) una nave da pesca, con attrezzi da pesca a strascico, alla fonda.', false);
INSERT INTO public.answers (id, question_id, answer_no, answer, correct) VALUES (1180, 394, 1, 'a) ciascuna di esse accosta a dritta.', true);
