INSERT INTO public.answers (id, question_id, answer_no, answer, correct) VALUES (1195, 399, 1, 'a) fanale di testa d''albero.', false);
INSERT INTO public.answers (id, question_id, answer_no, answer, correct) VALUES (1196, 399, 2, 'b) è un tipo di segnale non contemplato dal Regolamento per Prevenire gli Abbordi in Mare.', true);
INSERT INTO public.answers (id, question_id, answer_no, answer, correct) VALUES (1197, 399, 3, 'c) fanale di poppa o di coronamento.', false);
