INSERT INTO public.answers (id, question_id, answer_no, answer, correct) VALUES (1200, 400, 3, 'c) accendere solo il fanale di testa d''albero ed i fanali di via laterali.', false);
INSERT INTO public.answers (id, question_id, answer_no, answer, correct) VALUES (1201, 401, 1, 'a) due navi che non governano affiancate viste di prora.', false);
INSERT INTO public.answers (id, question_id, answer_no, answer, correct) VALUES (1202, 401, 2, 'b) due navi condizionate dalla loro immersione, affiancate, viste di prora.', false);
INSERT INTO public.answers (id, question_id, answer_no, answer, correct) VALUES (1203, 401, 3, 'c) due navi che effettuano rifornimento in mare, che mantengono abbrivio, viste di prora.', true);
INSERT INTO public.answers (id, question_id, answer_no, answer, correct) VALUES (1204, 402, 1, 'a) una seconda serie di fanali laterali disposti più a proravia dei primi.', false);
